The irrational number pi up to the 3,141th decimal place stored on the blockchain. Feel free to use each 3141x3141 sized image of pi however you see fit.

Half of all Pi for Nerds profits go to various STEM charities that improve the presence and influence of women and girls in STEM. Please visit pifornerds.io for more info.

